import React from 'react'
import { Field } from 'formik'

const options = [
    {value: 'Caracas', label:'Caracas', id:"1"},
    {value: 'Barquisimeto', label:'Barquisimeto',id:"2"},
    {value: 'Valencia', label:'Valencia' ,id:"3"},
    {value: 'Maracaibo', label:'Maracaibo', id:"4"}
]

const SelectCity = ({ error }) => {
    console.log(error)
    return (
        <div className="form-control">
            <Field
            placeholder="Introduce tu city"
            className={error ? "cityDropDownListError" : "cityDropDownList"}
            name="city"
            as="select"
            >
                <option value="default">Ciudad</option>
                {/* <option value="Caracas">Caracas</option>
                <option value="Caracas">Caracas</option> */}
                {
                    options.map(option => {
                        return(
                            <option
                            key={option.id}
                            value={option.value}
                            >
                                {option.value}

                            </option>
                        )

                    })
                }
            </Field>
        </div>
    )
}

export default SelectCity
